    false,nt"url": null,nt"notes": "In 1975 the USFWS began studies designed
    to define the biological characteristics of wild spring chinook (Oncorhynchus tshawytscha)
    and steelhead (O. mykiss) in the Warm Springs River. Additionally, research was
    initiated to document resident trout growth patterns and population status below
    the hatchery prior to hatchery releases. This report is an attempt to condense the
    wealth of information learned through these studies and document the evolutionary
    sequence of events that has molded the hatchery and management programs since 1975.
    It is hoped that this document will give the reader insight as to how a fishery
    program evolves and may help future managers anticipate the changes that may occur
    in these types of programs.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
